INSERT INTO `channels` VALUES (248, 0, 'UCcUB8t47AAu5WKmaUSdaN_g', 'Jucker Farm', 'ch', '-13-18-20-', 'Beat & Martin Jucker', 'jucker_farm', '', 'https://www.juckerfarm.ch', 'https://www.youtube.com/juckerfarmag', '', 'Obstbau zum Erlebnis machen. Das ist unser Ding. Angefangen hat alles vor 20 Jahren mit der verr√ºckten Idee einer K√ºrbisausstellung nachdem die Br√ºder Martin und Beat Jucker den elterlichen Hof √ºbernommen haben. Heute haben besteht die Jucker Farm AG aus 4 H√∂fen:<br /><br />Juckerhof in Seegr√§ben: Erlebnishof mit Restaurant, eigener B√§ckerei, Hofladen, √ñpfelGarte, Heidelbeeren und Kirschen Selberpfl√ºcken, Geisslipark und beste Lage am Pf√§ffikersee. Hier werden noch immer √Ñpfel und Birnen sowie einige Beeren und Wein produziert.<br /><br />B√§chlihof in Jona: Erlebnishof mit Hofladenrestaurant, Heidelbeeren zum Selberpfl√ºcken, Geissli und H√§sli, ideal gelegen in mitten von Obstb√§umen direkt am Obersee. Hier wachsen √Ñpfel, Birnen, Heidelbeeren und sogar ein paar Kiwis. Ausserdem befindet sich hier die Hofmanufaktur.<br /><br />Spargelhof in Rafz: Hier wachsen Spargeln, K√ºrbis und Co. Inkl. grossem Hofladen.<br /><br />R√∂merhof in Kloten: Hofladen und Blumen zum Selberpfl√ºcken.<br /><br />Wir freuen uns auf Ihren Besuch!', 'https://yt3.ggpht.com/ytc/AAUvwnj7ghRmgSLvqDnYOoPngo1O366JGNCPkfeJakNB6g=s88-c-k-c0x00ffffff-no-rj', '27.09.2009', '201231-16', '201231-16', 0, 0, 0, 246, 342, 436, NULL, 0, 0, 0, 220700, 273276, 329455, NULL, 209, NULL, 'Was ist nachhaltige Produktion?', '0IyJMO3YbzI', '<td class=\"yt-lastvideo\" data-sort=\"201210103706\" data-utime=\"201231-16\"><a href=\"https://youtu.be/0IyJMO3YbzI\" title=\"Was ist nachhaltige Produktion?\" target=\"_blank\">Do. 10.12.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/0IyJMO3YbzI/default.jpg)\"></div><p>Was ist nachhaltige Produktion?<br><br>Ver√∂ffentlicht am: Do. 10.12.20 um 10:37 Uhr</p><div class=\"