INSERT INTO `channels` VALUES (276, 0, 'UCrsd_S0gN5IHtAPdeVR_ivg', 'Florian Summer', 'ch', '-8-20-', '', 'florian_summer_music', '', 'http://www.floriansummer.ch', '', '', 'Mit seinem Debut Album ‚ÄûPoolboy‚Äú hat Florian Summer 2018 einen regelrechten Senkrechtstart hingelegt  und ist direkt auf Platz 11 der Schweizer-Album-Charts eingestiegen. Mit ‚ÄûRimini‚Äú  und \"Machu Picchu\" sind ihm zwei kleine Radiohits gelungen und der Festivalsommer 2018 mit √ºber 20 Konzerten war Rock&Roll pur. Medien schreiben √ºber ihn: \"He did the best show of all bands at the (Rock am Weiher) Festival\".Florian Summers Texte spielen mit Klischees, die er augenzwinkernd betrachtet und besitzen einen einzigartigen Charme, dem man sich nur schwer entziehen kann. Musikalisch verleiht der freche Newcomer dem Mundartpop ein erfrischendes Elektropop-Gewand und erschafft so seine ganz eigene Klangwelt. 2020 steht im Zeichen einer neuen Platte - TOYBOY!<br /><br />With his debut album ‚ÄúPoolboy‚Äù, Florian Summer mad an impressive start and entered the Swiss album charts at number 11. His second album \"Toyboy\" will come out this summer.', 'https://yt3.ggpht.com/ytc/AAUvwnhIjlFGf6ykn6hd1r7v67_newe8SVgB7dXYS5-DKg=s88-c-k-c0x00ffffff-no-rj', '04.03.2017', '201231-16', '201231-16', 0, 0, 0, 0, 0, 3040, NULL, 0, 0, 0, 0, 0, 8360392, NULL, 32, NULL, 'Florian Summer - Toyboy (alle Songs in 3 Minuten Challenge)', 'JHA7Mp8273E', '<td class=\"yt-lastvideo\" data-sort=\"201227184028\" data-utime=\"201231-16\"><a href=\"https://youtu.be/JHA7Mp8273E\" title=\"Florian Summer - Toyboy (alle Songs in 3 Minuten Challenge)\" target=\"_blank\">So. 27.12.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/JHA7Mp8273E/default.jpg)\"></div><p>Florian Summer - Toyboy (alle Songs in 3 Minuten Challenge)<br><br>Ver√∂ffentlicht am: So. 27.12.20 um 18:40 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/JHA7Mp8273E\" target=\"_blank\