INSERT INTO `channels` VALUES (370, 1, 'UCcm0WhMb0ipVG1YB_hX251A', 'On the Piano', 'ch', '-8-', '', 'on_the_piano', '', '', 'https://www.youtube.com/onthepiano', '', 'Hallo zusammen und Herzlich willkommen auf meinem Kanal.<br /><br />Ich heisse Stefano und komme aus der Schweiz. Im Juni 2015 habe ich mich endlich daf√ºr entschlossen das Klavierspielen zu erlernen. Auch wenn der Weg noch lang ist, m√∂chte ich zeigen was doch in so \"kurzer\" Zeit m√∂glich ist. <br />Ich bin 32 Jahre jung und das einzige Instrument dass ich gespielt habe war Gitarre in der Schulzeit f√ºr 3 Jahre. Musikalisch habe ich also von Null angefangen und mich mit Tutorials und learning by doing durchgeschlagen. <br />Das Leben ist zu kurz und man sollte seine Tr√§ume nie aufgeben.<br /><br />Die Musikst√ºcke sind sicher nicht perfekt und von einer richtigen K√∂rperhaltung oder Fingersatz ganz abzuschweigen, trotzdem hoffe ich dass es euch gef√§llt.<br /><br />Viel Spass', 'https://yt3.ggpht.com/a/AATXAJyarPIjtGBmCBhaUJaDxS2lNPXc3vwNMPtPm2Ot=s88-c-k-c0xffffffff-no-rj-mo', '15.03.2016', '201016-20', '201112-13', 0, 0, 168, 164, 161, 158, NULL, 0, 0, 3294, 4111, 3393, 3877, NULL, 6, NULL, 'James Arthur: Quite miss Home - Piano Cover', 'LVm7XkvyEUo', '<td class=\"yt-lastvideo\" data-sort=\"191123144826\" data-utime=\"201112-13\"><a href=\"https://youtu.be/LVm7XkvyEUo\" title=\"James Arthur: Quite miss Home - Piano Cover\" target=\"_blank\">Sa. 23.11.19</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i1.ytimg.com/vi/LVm7XkvyEUo/hqdefault.jpg)\"></div><p>James Arthur: Quite miss Home - Piano Cover<br><br>Views: 472 &nbsp; √ò/Video: 646<br>Ver√∂ffentlicht am: Sa. 23.11.19 um 14:48 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/LVm7XkvyEUo\" target=\"_blank\" class=\"red\">zum Video</a></div></div></td>', 472, '2019-11-23T13:48:26+00:00', '191123144826');
