INSERT INTO `channels` VALUES (439, 0, 'UCd0g-W4Y6H7DLThesh_eyzQ', 'Monotonus Studio', 'ch', '-6-8-', 'Moreno', '', '', '', '', '', 'Der ‚Äûmonotonus studio‚Äú Youtube-Kanal bietet Dir einiges! Und viel von Nichts.<br /><br />Auf diesem Kanal findest Du:<br />- ‚Ä¶keine n√ºtzlichen Lebensweisheiten <br />- ‚Ä¶keine hilfreichen Tipps um den Alltag zu meistern<br />- ‚Ä¶nichts was du nicht ohnehin schon wusstest (sofern du kein Honk bist)<br />- ‚Ä¶Erkl√§rungen w.z.B.: ‚ÄûHONK‚Äú ist die Abk√ºrzung f√ºr ‚ÄûHilfskraft ohne nennenswerte Kenntnisse‚Äú<br />Hier findest Du Dinge die dich evt. gar nicht interessieren.<br />Dinge die Du Dir aber trotzdem ansiehst weil sie den Anschein haben, dass sie Dein Interesse in absehbarer Zeit wecken k√∂nnten!<br />Dann bemerkst Du, dass es schon wieder nach Mitternacht ist; ...und es Zeit wird, Youtube zu schlie√üen‚Ä¶<br /><br />Hat Dich diese Beschreibung etwas verwirrt?<br />Dann tu am besten das, was die meisten Menschen auf dieser Plattform tun: Schau Dir die Videos an, lass dich vom Alltag etwas ablenken‚Ä¶ und wenn Dich auch nur ein kleiner Anteil - der auf diesem Kanal gezeigten Inhalte - unterhalten hat, wurde meine Intention erf√ºllt.<br /><br />Tschau z√§me!', 'https://yt3.ggpht.com/ytc/AAUvwnhORmvCFwi1RTe68fK37y25tSu6Uj2d3B1uk2y7=s88-c-k-c0x00ffffff-no-rj', '18.11.2019', '201231-16', '201231-16', 0, 0, 0, 0, 0, 142, NULL, 0, 0, 0, 0, 0, 25135, NULL, 64, NULL, 'LiveStream - MSFS - Take-Off And Landing Training, LOKL - Nikolsdorf Airport, Diamond Aircraft DA62', 'ajT9S5C_3QA', '<td class=\"yt-lastvideo\" data-sort=\"201227192939\" data-utime=\"201231-16\"><a href=\"https://youtu.be/ajT9S5C_3QA\" title=\"LiveStream - MSFS - Take-Off And Landing Training, LOKL - Nikolsdorf Airport, Diamond Aircraft DA62\" target=\"_blank\">So. 27.12.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/ajT9S5C_3QA/default.jpg)\"></div><p>LiveStream - MSFS - Take-Off And