INSERT INTO `channels` VALUES (440, 0, 'UCfw4267Wk701DJsX_GanRjA', 'Dani Kalt', 'ch', '-8-21-', '', '', '', 'https://www.klangtastisch.ch', '', '', 'KLANGTASTISCH ist mehr als ein Chor. Seit Jahren besch√§ftigt sich Dani Kalt mit der Chorarbeiit. Auch inspirieren ihn internationale Chorprojekte. Gepr√§gt hat ihn dann vollens Perpetuum Jazzile - der slovenische Chor mit Millionen Youtube Views. Daraus entstand nicht nur der Grundgedanken f√ºr Klangtastisch, nein, es trieb Dani f√∂rmlich an zu neuen M√∂glichkeiten zu greiffen. Dabei entwickelte sich Klangtastisch - die moderne Chorshow von Dani Kalt. <br /><br />Lass Dich verzaubern und verf√ºhren mit Musik. Klangtastisch, unter der Leitung von Dani Kalt, ist seit Oktober 2015 auf der B√ºhne.<br />Klangtastisch steht dabei f√ºr modernen, vielstimmigen Chorgesang. Die meisten Songs werden dabei a-capella gesungen. Alles was der Zuschauer h√∂rt wird dabei live erzeugt ‚Äì von der Leadstimme, Begleiung bis zum Schlagzeug (Beatboxer) ‚Äì alles 100% mit blosser Stimme erzeugt. Frischer, junger und moderner Gesang wie man ihn hier in der Schweiz nur erst ganz selten antrifft.<br /><br />Infos: klangtastisch.ch', 'https://yt3.ggpht.com/ytc/AAUvwngRWglAUKJ-2WjliDcj4Jnrxjazg-EHsZYI33vY=s88-c-k-c0x00ffffff-no-rj', '19.11.2006', '201231-16', '201231-16', 0, 0, 0, 0, 0, 549, NULL, 0, 0, 0, 0, 0, 396936, NULL, 82, NULL, 'Klangtastisch - JOY TO THE WORLD - LIVE XMAS Show', 'e0YZ4Ftl9_o', '<td class=\"yt-lastvideo\" data-sort=\"201225081036\" data-utime=\"201231-16\"><a href=\"https://youtu.be/e0YZ4Ftl9_o\" title=\"Klangtastisch - JOY TO THE WORLD - LIVE XMAS Show\" target=\"_blank\">Fr. 25.12.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/e0YZ4Ftl9_o/default.jpg)\"></div><p>Klangtastisch - JOY TO THE WORLD - LIVE XMAS Show<br><br>Ver√∂ffentlicht am: Fr. 25.12.20 um 08:10 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/e0YZ4Ftl9_o\" target=\"_bla