INSERT INTO `channels` VALUES (476, 0, 'UCLAkQSEz6wXbqgg6WtC1t9g', 'Learn Swiss German', 'ch', '-15-16-18-', 'Kathrin', 'swiss_german_online', '', 'https://www.swiss-german-online.com', 'https://www.youtube.com/learnswissgerman', '', 'My name is Kathrin. I am a Swiss-German teacher from Switzerland. I specialize in teaching conversational Swiss German. I am also fluent in German and French. The main focus of my lessons is on speaking. I am very flexible and always try to adjust to students needs and levels. The lessons can take place online via Skype or FaceTime or other messengers. During our conversation lessons, I make notes on our online document. If the students require I also make audio recordings from our notes.  <br /><br />I was brought up in Fribourg and went to school in Bern. My mother is from Zurich and father from Luzern. I am familiar with many dialects. <br /><br />If you are interested in improving your Swiss German feel free to contact me to arrange your first lesson with me.', 'https://yt3.ggpht.com/ytc/AAUvwnhA5f8mJuORyRWBIcc5yxV6dEg3YTNd4qdAfULnCA=s88-c-k-c0x00ffffff-no-rj', '13.05.2008', '201231-16', '201231-16', 0, 3965, 5336, 7454, 10100, 15100, NULL, 0, 2460134, 2759064, 1607569, 644770, 960355, NULL, 434, NULL, '\"Happy New Year\"  and wishes in Swiss German.', '2lY8bQ_XBhA', '<td class=\"yt-lastvideo\" data-sort=\"201231135838\" data-utime=\"201231-16\"><a href=\"https://youtu.be/2lY8bQ_XBhA\" title=\"\"Happy New Year\"  and wishes in Swiss German.\" target=\"_blank\">Do. 31.12.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/2lY8bQ_XBhA/default.jpg)\"></div><p>\"Happy New Year\"  and wishes in Swiss German.<br><br>Ver√∂ffentlicht am: Do. 31.12.20 um 13:58 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/2lY8bQ_XBhA\" target=\"_blank\" class=\"red\">zum Video</a></div></div></td>', 0, '2020-12-31T12:58:38Z', '201231135838');
INSERT INTO `channels` VALUES (477, 0, 'UC7gRJAzQ6zlpP0Kr7rfjJsw', 'Matteo', 'ch', '-8-12-32-', 'Matteo Gisler', 'eifachnurmatteo', '', 'https://matthewcorvin.com', '', 'https://anchor.fm/chuchichaestli', 'Matteo wusste bereits im Kindesalter, dass die Musik seine Leidenschaft ist. Damals noch heimlich im Zimmer, sp√§ter dann in der Schule am Xylophon, um dann schlussendlich zur Gitarre zu greifen.<br /><br />Im Juni 2015 fiel der offizielle Startschuss f√ºr den damals 16-J√§hrigen: Als Singer-Songwriter pr√§sentierte er seine eigenen Songs erstmals der √ñffentlichkeit. Sp√§ter kamen einige Instrumente mehr hinzu und die Band ‚ÄûKind of a Mate‚Äú war geboren.<br /><br />Nach zwei ver√∂ffentlichten EPs und mehr als 100 gespielten Konzerten in der ganzen Schweiz geht Matteo dieses Jahr nun neue Wege: 2020 m√∂chte er dem Experimentieren mehr Beachtung schenken. F√ºr mehr Spontanit√§t und weniger Verkopftheit und Planung ‚Äì √ºber Genre- und Sprachgrenzen hinausdenkend. Mit seinem Solo-Projekt wagt er den Schritt zur ehrlichen Mundart-Musik, irgendwo zwischen Pop und Hip-Hop.<br /><br />Das Songbird Festival Davos, das Stars in Town in Schaffhausen oder auch das Konzerthaus Sch√º√ºr in Luzern setzten bereits auf den Musiker dem Kanton Uri', 'https://yt3.ggpht.com/ytc/AAUvwnixs1UmZ2eN2Evn2C8DAoJL5M1ZyOm8xXOBzzBpqw=s88-c-k-c0x00ffffff-no-rj', '28.06.2016', '201231-16', '201231-16', 0, 8, 8, 31, 42, 58, NULL, 0, 149, 191, 493, 68, 1611, NULL, 3, NULL, 'Nowhereland ‚Äì Matteo (Live Piano Version)', 'Mo8c79hDIrc', '<td class=\"yt-lastvideo\" data-sort=\"200621223348\" data-utime=\"201231-16\"><a href=\"https://youtu.be/Mo8c79hDIrc\" title=\"Nowhereland ‚Äì Matteo (Live Piano Version)\" target=\"_blank\">So. 21.06.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/Mo8c79hDIrc/default.jpg)\"></div><p>Nowhereland ‚Äì Matteo (Live Piano Version)<br><br>Ver√∂ffentlicht am: So. 21.06.20 um 22:33 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/Mo8c79hDIrc\" target=\"_blank\" class=\"red\">zum Video</a></div></div></td>', 0, '2020-06-21T20:33:48Z', '200621223348');
