INSERT INTO `channels` VALUES (587, 1, 'UCfjP7DpvANUKUcJi4klX1_Q', 'Daytrippers CH', 'ch', '-1-22-', 'Diana & Pascal', 'daytrippers.ch', '', 'https://www.daytrippers.ch', 'https://www.youtube.com/daytrippersch', '', 'Reisen ist unsere Leidenschaft und unser Blog gibt uns die M√∂glichkeit diese mit dem Rest der Welt zu teilen. daytrippers.ch ist ein Ort der Inspiration f√ºr neue Abenteuer und um den Mut zu finden selber los zu gehen. Egal ob dies f√ºr eine grosse Reise ans andere Ende der Welt ist oder f√ºr einen Tagesausflug direkt vor der eigenen Haust√ºr. Mit Worten, Bildern und Videos halten wir Geschichten f√ºr euch fest und mit der Drohne im Handgep√§ck erhaltet ihr einen noch spannenderen Einblick. Ein Ticket braucht ihr nicht, zur√ºck lehnen und digital ein Teil von unseren Erlebnisreisen sein.', 'https://yt3.ggpht.com/a/AATXAJzA-qLTse4LYelEykv6yPw6PGbPAqkD98xbawLGKQ=s88-c-k-c0xffffffff-no-rj-mo', '02.11.2011', '201016-20', '201112-13', 0, 0, 73, 128, 146, 152, NULL, 0, 0, 22943, 39841, 53958, 66803, NULL, 59, NULL, 'Zu Besuch im Oberammergau - daytrippers.ch', 'vywqN4pIwKk', '<td class=\"yt-lastvideo\" data-sort=\"190829122222\" data-utime=\"201112-13\"><a href=\"https://youtu.be/vywqN4pIwKk\" title=\"Zu Besuch im Oberammergau - daytrippers.ch\" target=\"_blank\">Do. 29.08.19</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i3.ytimg.com/vi/vywqN4pIwKk/hqdefault.jpg)\"></div><p>Zu Besuch im Oberammergau - daytrippers.ch<br><br>Views: 139 &nbsp; √ò/Video: 1132<br>Ver√∂ffentlicht am: Do. 29.08.19 um 12:22 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/vywqN4pIwKk\" target=\"_blank\" class=\"red\">zum Video</a></div></div></td>', 139, '2019-08-29T10:22:22+00:00', '190829122222');
INSERT INTO `channels` VALUES (588, 0, 'UC1O11cu8KytoogFFPkssLGg', 'DJ OB ONE', 'ch', '-8-', '√ñzg√ºr Baris Temirci', 'djobone', '', 'https://www.djobone.ch', '', '', 'DJ OB One ist aus der Schweizer Clublandschaft nicht mehr wegzudenken. Kaum einer bringt so viel Leidenschaft und renommierte Projekte unter einen Hut, wie er. Den Ursprung hat der 30-J√§hrige Z√ºrcher im B-Boying. So ist es auch kein Wunder, dass er bei Line Ups vom Battle Of The Year, Red Bull BC One & Royal Arena jeweils mit von der Partie ist.<br />Doch als w√§re das nicht genug, ist OB One auch der DJ vom Kollektiv No Basic und war bei der legend√§ren Freestyle Convention dabei. Neben den Beats, die er produziert, l√§sst sich der ambitionierte Plattensammler nicht nur in die reine Hip-Hop-Schublade stecken: Egal ob Soul, Funk, Trap oder orientalische Folklore ‚Äì es gibt nichts, was er nicht in seinem Repertoire hat. So ist er immer wieder gern gesehener DJ nicht nur an den angesagtesten Partys der Nation, sondern auch an Hochzeiten und anderen Anl√§ssen.<br />Wer also viel Wert auf Ambition & Flavour legt und gerne von schon l√§ngst vergessenen Songs √ºberrascht wird, kommt um DJ OB One nicht herum.', 'https://yt3.ggpht.com/ytc/AAUvwnjBGQA32alla3epevRgkSZhmI7eS51WVm1l7su6=s88-c-k-c0x00ffffff-no-rj', '16.04.2009', '201231-16', '201231-16', 0, 0, 209, 225, 234, 266, NULL, 0, 0, 286796, 293375, 293366, 297123, NULL, 88, NULL, 'DJ OB One x Sucuk Mafia', 'xx9nR56md3s', '<td class=\"yt-lastvideo\" data-sort=\"200513124106\" data-utime=\"201231-16\"><a href=\"https://youtu.be/xx9nR56md3s\" title=\"DJ OB One x Sucuk Mafia\" target=\"_blank\">Mi. 13.05.20</a><div class=\"info\"><div class=\"close\"></div><div class=\"circle\" style=\"background-image:url(https://i.ytimg.com/vi/xx9nR56md3s/default.jpg)\"></div><p>DJ OB One x Sucuk Mafia<br><br>Ver√∂ffentlicht am: Mi. 13.05.20 um 12:41 Uhr</p><div class=\"abobar\"><a href=\"https://youtu.be/xx9nR56md3s\" target=\"_blank\" class=\"red\">zum Video</a></div><